    "Aerial bird survey of the coastal waters of Kodiak Island, Alaska, March 9-14,
    1977",nt"tracking_summary": {ntt"total": 2,ntt"recent": 1nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2016-07-27T23:03:07.269392",nt"name":
    "aerial-bird-survey-of-the-coastal-waters-of-kodiak-island-alaska-march-9-14-1977",nt"isopen":
    false,nt"url": null,nt"notes": "A total of 26,036 individuals of 29 nominal
    species were observed during an aerial survey conducted March 9-14, 1977 which covered
    more than 90% of the Kodiak Island coastline. The population density in the coastal
    waters was conservatively estimated at 100.71 u00b1 24.68 birds/km2. The winter
    bird population is composed primarily of sea ducks 51%, dabbling ducks (17%), diving
    ducks (12%), gulls (8%), and alcids (6%). The upper ends of the bays and estuaries
    contained high concentrations (up to 368 birds/km2) of dabbling ducks, goldeneye,
    scoters, and murres. Results are compared with previous surveys and the distribution
    pattern of each species is discussed.",nt"license_title": "License Not Specified",nt"extras":
